import React from 'react';

import '../App.css'
import AccendreIcon from '../assets/accendre.svg'
export function ProjectAccendre(props) {

    return (
        <div
        className='projects'
        id = "accendre"
        >
        <hr></hr>
        <img src = {AccendreIcon} id = "titleImage"></img>
        <div className = 'synopsisCon'>
            <h2>Synopsis</h2>
            <h4>September 2021 - May 2023</h4>
        </div>
        </div>



        );

}
